INSERT INTO xcart_products VALUES (92,'SKU92','Cranium',1,'',1.00,46.65,'The outrageous new board game for your whole brain, containing 14 fun activities giving everyone a chance to shine.','The outrageous new board game for your whole brain, containing 14 fun activities giving everyone a chance to shine.\n<br /><br />\n<b>Features:</b>\n<ul>\n<li>The brain-tickling game that\'s fun for the whole family</li>\n<li>800 wacky cards challenge you to think in ways you never dreamed possible</li>\n<li>Draw with your eyes closed, spell backwards, hum a tune, answer trivia and more</li>\n<li>Includes game board, 800 cards, 10-side die, Cranium clay, timer, custom pads and pencils, rules and 4 game pieces</li>\n<li>For 4 or more players; ages 13 yrs. and up</li>\n</ul>',100,2,'Y',2147483647,1,0,0,0.00,'N','Y',1,10.00,8.00,10.00,10,'N','N',0,0,'','','','N','N',1,'');
INSERT INTO xcart_products VALUES (10,'SKU10','Flash 5 for Windows and Macintosh',1,'',1.00,79.99,'A guide to getting a quick start with Macromedia Flash 5 for Windows and Macintosh, with an easy reference-like format that lets the reader look up what they want to learn and get straight to work. Uses pictures to teach concepts instead of wordy explanations.','Macromedia Flash was already the industry standard for creating interactive vector graphics and Web animation &mdash; and now it\'s even better. With the latest edition of <em>Flash 5 for Windows and Macintosh</em>, you\'ll learn the basics of vector drawing, plus tackle new features, like custom panel layouts, Pen Tools and bezier controls, customized keyboard shortcuts, Movie Explorer and much more.\n<br /><br />\nWith step-by-step instructions for creating Flash movies, incorporating sound, and adding other multimedia effects to your site, this thorough, concise guide is intended for seasoned pros and eager novices alike. Like all Visual QuickStart Guides, it\'s filled with the screen shots, tips and techniques to make it a welcome addition to any Web designer\'s collection.',100,10,'Y',2147483647,5,0,1,0.00,'N','Y',1,10.00,8.00,10.00,10,'N','N',0,0,'','','','N','N',1,'');
INSERT INTO xcart_products VALUES (12,'SKU12','Photoshop 6 Down and Dirty Tricks',1,'',1.00,79.99,'Down &amp; Dirty Tricks is packed cover to cover with step-by-step tutorials on the coolest Photoshop 6.0 effects. The book is not another rehash of masking, pixels, and file formats or resolution &mdash; it\'s nothing but the cool stuff that will make your client\'s (or boss\'s) jaw drop.','Scott Kelby, Editor of Photoshop User magazine and nationally-known Photoshop guru, unlocks the secrets of the most closely guarded Photoshop 6.0 secrets in this update to his amazing Photoshop special effects cookbook. It\'s packed cover to cover with step-by-step tutorials on the coolest Photoshop 6.0 effects. No boring chapters on masking, no explanations of what a pixel is, no discussions of file formats or resolution &mdash; it\'s nothing but the cool stuff that will make your client\'s (or boss\'s) jaw drop.\n<br /><br />\nPlus, it\'s an awesome Photoshop tips book too! That\'s because next to every tutorial, on every single page, there\'s a sidebar with a timesaving Photoshop 6.0 tip, trick, shortcut, or real-world technique to save you time, money, and make you more efficient. In fact, there\'s enough tips in this book that it would make a great Photoshop tips book by itself, even without all the special effects! With nearly 700 full-color images, you can see every trick, step-by-step, throughout the entire book. Best of all, the whole book is written in plain English, and you can jump in anywhere; simply open the book to the effect you want to create and follow along. It\'s that easy (and that much fun!). That\'s why this is the book that Dave Huss\' Graphically Speaking column called \"The mother of all Photoshop books!\"\n<br /><br />\nYou\'ll learn:<br />\n<ul>\n<li>Amazing chrome and metallic effects</li>\n<li>6.0 Type effects that will knock them out!</li>\n<li>How to create those dazzling high-tech Web interfaces</li>\n<li>Cool 3D effects using Photoshop\'s own filters</li>\n<li>Photographic techniques that make you look like a pro</li>\n<li>The most popular Photoshop Web effects</li>\n<li>Shadow techniques that the pros really use</li>\n<li>Instant texture and background effects</li>\n<li>Amazing paint and brush tricks</li>\n<li>The most requested advertising effects</li>\n<li>And much, much more</li>\n</ul>\nIf you\'re ready to learn the funk and not the junk; if you want to get in there and start creating the same effects you see in national magazines, on TV, and on the Web; if you\'re ready to learn the inside secrets for creating those eyepopping special effects that everyone wants to use &mdash; this book is for you!',88,11,'Y',2147483647,30,12,0,0.00,'N','Y',1,10.00,8.00,10.00,10,'N','N',0,0,'photoshop, photoshop 6','','','N','N',1,'');
INSERT INTO xcart_products VALUES (201,'SKU201','Motorola StarTAC ST7797',1,'',1.00,188.89,'Simply pick up the Motorola StarTAC ST7797 phone, and you\'ll sense its quality. Use it, and you\'ll find a host of features and conveniences, including dual-band TDMA support, smart-button navigation, short  message capabilities, and solid battery performance. While it lacks Web-browser support, if you\'re looking for a dependable, competent phone, you\'ve found it here.','Simply pick up the Motorola StarTAC ST7797 phone, and you\'ll sense its quality. Use it, and you\'ll find a host of features and conveniences, including dual-band TDMA support, smart-button navigation, short  message capabilities, and solid battery performance. While it lacks Web-browser support, if you\'re looking for a dependable, competent phone, you\'ve found it here.\n<br /><br />\n<ul type=\"disc\">\n<li>Lightweight, efficient design</li>\n<li>Solid construction, intuitive keypad and controls</li>\n<li>Vibrating call alert</li>\n<li>Dual NAM capability</li>\n<li>Up to 170 hours\' standby, 130 minutes\' talk time with standard battery</li>\n</ul>',95,9,'Y',2147483647,3,5,1,0.00,'N','Y',1,10.00,8.00,10.00,10,'N','N',0,0,'','','','N','N',1,'');
INSERT INTO xcart_products VALUES (111,'SKU111','Vidocq',1,'',1.00,44.44,'Paris. 1830. In the heart of the town, Vidocq, a famous detective, disappeared as he fights the Alchemist, an assassin that he has been pursuing for a few months. His young biographer, Etienne Boisset, decides to have revenge on Vidocq\'s death and takes on the investigation.','',100,2,'Y',2147483647,0,0,0,0.00,'N','Y',1,10.00,8.00,10.00,10,'N','N',0,0,'','','','N','N',1,'');
INSERT INTO xcart_products VALUES (86,'SKU86','Rock \'N Roll Ernie',1,'',1.00,13.33,'Here\'s a side of Sesame Street\'s Ernie that you\'ve probably never seen before. Ernie plays songs and his arms move to make it look like he is really playing the guitar. He sings and shakes also. Sings songs such as ...Splish Splash I was taking a bath and Rock Around the Clock.','',100,0,'Y',2147483647,0,0,0,0.00,'N','Y',1,10.00,8.00,10.00,10,'N','N',0,0,'doll','','','N','N',1,'');
INSERT INTO xcart_products VALUES (85,'SKU85','RAD Robot (27 MHz)',1,'',1.00,106.65,'The ultimate, high performance Remote Control Robot! Tough treads allow RAD to conquer rough terrain indoors or outdoors. With dual-speed, RAD goes forward, backward, left and right, and does a 360 degree spin.','',100,0,'Y',2147483647,0,0,0,0.00,'N','Y',1,10.00,8.00,10.00,10,'N','N',0,0,'robot','','','N','N',1,'');
INSERT INTO xcart_products VALUES (83,'SKU83','ViaVoice Pro 7.0 Millennium Edition',1,'/provider/via_voice_70.zip',1.00,45.32,'Introducing the exciting ViaVoice Millennium product line, the next generation of ViaVoice technology. Built on IBM\'s established history in speech recognition research and development, the software brings together today\'s most advanced voice recognition capabilities into a product family that boasts improved accuracy, enhanced command and control features to easily navigate the Web and speech-enabled Web browsing. Professional, Web, Standard and Personal editions available for Microsoft Windows 95, Windows 98 or Windows NT Workstation 4.0 with Service Pack 4.','Introducing the exciting ViaVoice Millennium product line, the next generation of ViaVoice technology. Built on IBM\'s established history in speech recognition research and development, the software brings together today\'s most advanced voice recognition capabilities into a product family that boasts improved accuracy, enhanced command and control features to easily navigate the Web and speech-enabled Web browsing. Professional, Web, Standard and Personal editions available for Microsoft Windows 95, Windows 98 or Windows NT Workstation 4.0 with Service Pack 4.\n<br /><br />\n<b>Features:</b>\n<ul>\n<li>Use voice commands to control and navigate your desktop, applications, and the Internet</li>\n<li>Input, edit, and format text by voice using Microsoft Word 97 and 2000; Microsoft Excel 97 and 2000; and Microsoft Outlook 97, 98, and 2000</li>\n<li>Explore specialized topics such as Cuisine, Chatters Jargon, Business &amp; Finance, and Computer</li>\n<li>Proofread your documents with the ViaVoice Outloud text-to-speech feature</li>\n<li>Includes optional legal and medical dictionaries</li>\n</ul>',100,4,'Y',2147483647,4,0,0,0.00,'N','Y',1,10.00,8.00,10.00,10,'N','N',0,0,'','','','N','N',1,'');
INSERT INTO xcart_products VALUES (80,'SKU80','Offspring - Smash',1,'',1.00,18.65,'Call them the Nine Inch Nails of punk. Like NIN, the Offspring preserve the essential ingredients of their chosen genre - guitars grinding out three chords, shouted vocals, and plenty of vitriol - and layer them over a melodic base that packs considerable popular appeal.','Call them the Nine Inch Nails of punk. Like NIN, the Offspring preserve the essential ingredients of their chosen genre - guitars grinding out three chords, shouted vocals, and plenty of vitriol - and layer them over a melodic base that packs considerable popular appeal. The singles from <em>Smash</em>, the Offspring\'s breakthrough album, still receive considerable radio airplay: \"Gotta Get Away\", \"Come Out and Play\", and \"Self Esteem\". With these and Smash\'s 11 other tracks, the band chronicles the adolescent experience with clarity and surprisingly incisive wit. That pretty much describes all of their albums, but this is the one to get. It\'s got more shape than their earlier material and isn\'t as disturbingly poppy as their more recent recordings; it\'s the perfect blend of riffs and rage.',100,0,'Y',2147483647,0,0,0,0.00,'N','Y',1,10.00,8.00,10.00,10,'N','N',0,0,'','','','N','N',1,'');
INSERT INTO xcart_products VALUES (81,'SKU81','Eva Cassidy - Songbird',1,'',1.00,15.84,'Songbird is a posthumous anthology culled from the album Live At Blues Alley and her other solo release, Eva By Heart, along with one track from her 1992 duet album with Chuck Brown titled The Other Side.','<em>Songbird</em> cherry-picks tracks from the three locally released albums of Eva Cassidy, whose hauntingly beautiful vocals went virtually unheard outside her native Washington, D.C., during her short 33 years with us. Lost to melanoma in 1996, Cassidy sang with an unaffected purity and an astonishing ability to make both classic and contemporary songs sound like they were written just for her. Sting\'s \"Fields of Gold\" finally lives up to its title through the alchemy of Cassidy\'s transcendent rendition, while other tracks on this anthology showcase her ease in the realms of pop (Christine McVie\'s \"Songbird\"), soul (\"People Get Ready\"), gospel (\"Wade on the Water\"), and traditional standards (\"Autumn Leaves\" and \"Over the Rainbow\"). Framed by understated jazz and pop arrangements, Cassidy\'s clear, soulful voice and exquisite phrasing make her that rarest of vocalists whose interpretations are a complement to any song. A fine introduction to a true talent.',100,0,'Y',2147483647,0,0,0,0.00,'N','Y',1,10.00,8.00,10.00,10,'N','N',0,0,'','','','N','N',1,'');
INSERT INTO xcart_products VALUES (82,'SKU82','Alicia Keys - Songs in A Minor',1,'',1.00,16.77,'She may be beautiful, but Alicia Keys is a musician first and foremost. She plants herself firmly behind the piano keys on her debut, unlike many of the booty-waggin\' junior divas who are crowding the R&amp;B videoscape these days.','She may be beautiful, but Alicia Keys is a musician first and foremost. She plants herself firmly behind the piano keys on her debut, unlike many of the booty-waggin\' junior divas who are crowding the R&amp;B videoscape these days. Though many of the tracks on <em>Songs in A Minor</em> are embellished with adolescent angst, this 20-year-old\'s substantial, gorgeously soul-drenched alto putties the cracks between notes with astonishing ease. \"Fallin\'\", the album\'s first single, showcases Keys at her best. She wails plaintively and passionately over rolling blues chords, in the tradition of the greats that this young talent clearly wants to align herself with - Stevie Wonder, Donny Hathaway, and Aretha Franklin. She swoops and soars over the spicy, flamenco-fueled melody that opens \"Mr. Mann\", one of the many winning tracks gathered here. And she digs deep into a remake of the beloved Prince B-side, \"How Come U Don\'t Call Me Anymore?\" packing more heat into her melismatic wails than most singers twice her age.',100,0,'Y',2147483647,0,0,0,0.00,'N','Y',1,10.00,8.00,10.00,10,'N','N',0,0,'','','','N','N',1,'');
INSERT INTO xcart_products VALUES (78,'SKU78','O Brother, Where Art Thou? (Soundtrack)',1,'',1.00,17.71,'The best soundtracks are like movies for the ears, and <em>O Brother, Where Art Thou?</em> joins the likes of <em>Saturday Night Fever</em> and <em>The Harder They Come</em> as cinematic pinnacles of song. The music from the Coen brothers\' Depression-era film taps into the source from which the purest strains of country, blues, bluegrass, folk, and gospel music flow.','The best soundtracks are like movies for the ears, and <em>O Brother, Where Art Thou?</em> joins the likes of <em>Saturday Night Fever</em> and <em>The Harder They Come</em> as cinematic pinnacles of song. The music from the Coen brothers\' Depression-era film taps into the source from which the purest strains of country, blues, bluegrass, folk, and gospel music flow.\n<br /><br />\nProducer T Bone Burnett enlists the voices of Alison Krauss, Gillian Welch, Emmylou Harris, Ralph Stanley, and kindred spirits for performances of traditional material, in arrangements that are either a cappella or feature bare-bones accompaniment. Highlights range from the aching purity of Krauss\'s <em>\"Down to the River to Pray\"</em> to the plainspoken faith of the Whites\' <em>\"Keep on the Sunny Side\"</em> to Stanley\'s chillingly plaintive <em>\"O Death\"</em>. The album\'s spiritual centerpiece finds Krauss, Welch, and Harris harmonizing on <em>\"Didn\'t Leave Nobody but the Baby\"</em>, a gospel lullaby that sounds like a chorus of Appalachian angels.',100,0,'Y',2147483647,0,0,0,0.00,'N','Y',1,10.00,8.00,10.00,10,'N','N',0,0,'','','','N','N',1,'');
INSERT INTO xcart_products VALUES (79,'SKU79','Melissa Etheridge - Skin',1,'',1.00,17.71,'During the dark days of the singer\'s split from Julie Cypher, her companion of 12 years, Melissa Etheridge retreated to her home studio to pen songs lit from within with her searing pain and confusion. From those heart-wrenching sessions comes arguably Etheridge\'s finest work. She vents and rages and all but spits on her Tony Llama boots, giving these 10 songs a depth and grit that she only hinted at in her prior six albums.','During the dark days of the singer\'s split from Julie Cypher, her companion of 12 years, Melissa Etheridge retreated to her home studio to pen songs lit from within with her searing pain and confusion. From those heart-wrenching sessions comes arguably Etheridge\'s finest work. She vents and rages and all but spits on her Tony Llama boots, giving these 10 songs a depth and grit that she only hinted at in her prior six albums. And those early albums were plenty gritty. But early tunes such as <em>\"Come to My Window\"</em>, and <em>\"Yes I Am\"</em> don\'t approach the naked vulnerability heard here - even though the breakup was hinted at in <em>\"Stronger Than Me\"</em>, on 1999\'s Breakdown. Skin peels back layers of Etheridge\'s pain and addresses her personal melodrama in such a compelling way that her despair is transmuted into true art, as she takes the listener through the stages of grief and recovery. And what a journey, beginning with the bristling <em>\"Lover Please\"</em> (\"Didn\'t I love you right / Then tell me where are you going dressed to kill tonight? / Oh, this one\'s gonna hurt like hell\") and ending with the stirring <em>\"Heal Me\"</em>, which features background vocals by famous pals Laura Dern and Meg Ryan. That\'s almost all the help she has on the record; Etheridge plays almost all the instruments and penned all the songs. But, ultimately, Skin is the sound of one heart breaking.',100,2,'Y',2147483647,1,0,0,0.00,'N','Y',1,10.00,8.00,10.00,10,'N','N',0,0,'','','','N','N',1,'');
INSERT INTO xcart_products VALUES (77,'SKU77','Bach: Cello Suites (Double-CD)',1,'',1.00,41.76,'<b>Composer:</b> Johann Sebastian Bach<br />\n<b>Performer:</b> Mstislav Rostropovich','<b>Composer:</b> Johann Sebastian Bach<br />\n<b>Performer:</b> Mstislav Rostropovich<br />\n<b>On this CD:</b><br />\n<ol>\n<li>Suite for solo cello No. 1 in G major, BWV 1007</li>\n<li>Suite for solo cello No. 4 in E flat major, BWV 1010</li>\n<li>Suite for solo cello No. 5 in C minor, BWV 1011</li>\n<li>Suite for solo cello No. 2 in D minor, BWV 1008</li>\n<li>Suite for solo cello No. 3 in C major, BWV 1009</li>\n<li>Suite for solo cello No. 6 in D major, BWV 1012</li>\n</ol>',100,2,'Y',2147483647,1,0,0,0.00,'N','Y',1,10.00,8.00,10.00,10,'N','N',0,0,'bach, cello suites','','','N','N',1,'');
INSERT INTO xcart_products VALUES (76,'SKU76','Bach\'s Goldberg Variations',1,'',1.00,18.65,'<b>Composer:</b> Johann Sebastian Bach<br />\n<b>Performer:</b> Murray Perahia','As the legend goes, <em>Bach\'s Goldberg Variations</em> were written for an insomniac diplomat patron who desired music to help cheer him on lonely, sleepless nights. But the real legend is how Bach was able to produce, for an apparently throwaway occasion, one of the crowning masterpieces not only of the Baroque, but of all Western music. Here\'s a gathering of widely varied interpretations the music has inspired, from keyboard masters to arrangements for string orchestra, jazz trio, and even brass band.\n<br /><br />\nThanks to the Bach anniversary year, we\'ve enjoyed a bonanza of interpretations of the master. One of the most honestly compelling &mdash; Murray Perahia\'s account of the Goldberg Variations &mdash; uniquely underscored the fundamental subtext behind all the celebration: the wondrous inexhaustibility of Bach\'s creative imagination. Perahia has come to a new understanding of Bach in the full prime of his career, and his first recording of this monument communicates the wealth of his insights with color, depth, and subtly charged poetry.',100,0,'Y',2147483647,6,0,0,0.00,'N','Y',1,10.00,8.00,10.00,10,'N','N',0,0,'bach, goldberg variations','','','N','N',1,'');
INSERT INTO xcart_products VALUES (67,'SKU67','Designing Web Usability',1,'',1.00,0.00,'Users experience the usability of a web site before they have committed to using it and before making any purchase decisions. The web is the ultimate environment for empowerment, and he or she who clicks the mouse decides everything. <em>Designing Web Usability</em> is the definitive guide to usability from Jakob Nielsen, the world\'s leading authority. Over 250,000 Internet professionals around the world have turned to this landmark book, in which Nielsen shares the full weight of his wisdom and experience. From content and page design to designing for ease of navigation and users with disabilities, he delivers complete direction on how to connect with any web user, in any situation. Nielsen has arrived at a series of principles that work in support of his findings: 1. That web users want to find what they\'re after quickly; 2. If they don\'t know what they\'re after, they nevertheless want to browse quickly and access information they come across in a logical manner. This book is a must-have for anyone who thinks seriously about the web.','',99,9,'Y',2147483647,18,1,2,0.00,'N','Y',1,10.00,8.00,10.00,10,'N','N',0,0,'','','','N','N',1,'');
INSERT INTO xcart_products VALUES (68,'SKU68','HTML 4 for the World Wide Web',1,'',1.00,26.65,'HyperText Markup Language (HTML) is the lingua franca of the Web, and like any language, it\'s constantly evolving. You\'ll find all the concise, practical advice--and fun examples - that made the first edition a worldwide bestseller, plus entirely new coverage of debugging, JavaScript, and using tables for page layout, and an expanded section on Cascading Style Sheets. This book breaks even the most complex tasks into easy-to-follow steps illustrated with hundreds of screenshots and the actual code. The book presumes no prior knowledge of HTML, making it the perfect introduction for beginners. But its tabbed format and info-packed appendixes (on special HTML characters and Web-safe colors, for example) also make it a handy and indispensable reference for those who build Web pages for a living. Find out why this book is often called the \"dream guide\" to HTML.','',100,0,'Y',2147483647,2,0,0,0.00,'N','Y',1,10.00,8.00,10.00,10,'N','N',0,0,'','','','N','N',1,'');
INSERT INTO xcart_products VALUES (69,'BOOK0089','Dreamweaver 3 Bible : Gold Edition',1,'',1.00,79.99,'Introducing the ultimate Dreamweaver resource! This Gold Edition Bible adds 10 new chapters to cover everything professional Web developers need to develop dynamic, cutting-edge Web sites with Dreamweaver--including coverage of advanced active databases, customizing and extending the Dreamweaver environment, and e-commerce extensions not available elsewhere. The two CD-ROMs contain a trial version of Dreamweaver 3 along with lots of plug-ins, templates, and extensions.','',100,4,'Y',2147483647,0,0,0,0.00,'N','Y',1,10.00,8.00,10.00,10,'N','N',0,0,'','','','N','N',1,'');
INSERT INTO xcart_products VALUES (70,'SKU70','Javascript: Definitive Guide',1,'',1.00,39.90,'JavaScript is a powerful, object-based scripting language; JavaScript programs can be embedded directly in HTML web pages. When combined with the Document Object Model (DOM) defined by a web browser, JavaScript allows you to create Dynamic HTML content and interactive client-side web applications. JavaScript syntax is based on the popular programming languages C, C++, and Java, which makes it familiar and easy to learn for experienced programmers. At the same time, JavaScript is an interpreted scripting language, providing a flexible, forgiving programming environment in which new programmers can learn.','JavaScript is a powerful, object-based scripting language; JavaScript programs can be embedded directly in HTML web pages. When combined with the Document Object Model (DOM) defined by a web browser, JavaScript allows you to create Dynamic HTML content and interactive client-side web applications. JavaScript syntax is based on the popular programming languages C, C++, and Java, which makes it familiar and easy to learn for experienced programmers. At the same time, JavaScript is an interpreted scripting language, providing a flexible, forgiving programming environment in which new programmers can learn.\n<br /><br />\n<em>JavaScript: The Definitive Guide</em> provides a thorough description of the core JavaScript language and both the legacy and standard DOMs implemented in web browsers. The book includes sophisticated examples that show you how to handle common tasks, like validating form data, working with cookies, and creating portable DHTML animations. The book also contains detailed reference sections that cover the core JavaScript API, the legacy client-side API, and the W3C standard DOM API, documenting every JavaScript object, method, property, constructor, constant, function, and event handler in those APIs.\n<br /><br />\nThis fourth edition of the bestselling JavaScript book has been carefully updated to cover JavaScript 1.5 (ECMAScript version 3). The book also provides complete coverage of the W3C DOM standard (Level 1 and Level 2), while retaining material on the legacy Level 0 DOM for backward compatibility. JavaScript: The Definitive Guide is a complete programmer\'s guide and reference manual for JavaScript. It is particularly useful for developers working with the latest standards-compliant web browsers, like Internet Explorer 6, Netscape 6, and Mozilla. HTML authors can learn how to use JavaScript to build dynamic web pages. Experienced programmers can quickly find the information they need to start writing sophisticated JavaScript programs. This book is an indispensable reference for all JavaScript programmers, regardless of experience level.',2,23,'Y',2147483647,84,8,6,0.00,'N','Y',1,10.00,8.00,10.00,10,'N','N',0,0,'','','','N','N',1,'');
INSERT INTO xcart_products VALUES (66,'SKU66','Professional Java Server Programming',1,'',1.00,63.99,'An overview of the new server-side Java platform - Java 2 Enterprise Edition - as it relates to building n-tier web applications. It covers the building blocks (Servlets, JSP, EJB, JDBC, RMI, JNDI, CORBA) then goes into special design considerations for server side programming, (including resource pooling and component based design) before finally discussing future possibilities opened up by Jini and JavaSpaces technology.','An overview of the new server-side Java platform - Java 2 Enterprise Edition - as it relates to building n-tier web applications. It covers the building blocks (Servlets, JSP, EJB, JDBC, RMI, JNDI, CORBA) then goes into special design considerations for server side programming, (including resource pooling and component based design) before finally discussing future possibilities opened up by Jini and JavaSpaces technology.\n<br />\nIn a world where, increasingly, corporate IT development is Web application development - ASP, PHP, CGI and ISAPI are all viable options.Now, so is the Java 2 Platform Enterprise Edition, and that\'s good news because server-side Java is portable across Windows, Linux, UNIX and MacOS and compatible with a wide range of Web Servers (IIS, Apache, Netscape Enterprise Server) and Application Servers from Sun, IBM and others.\n<br />\nWhat does all this mean for you? Java provides technologies to allow for server side processing, dynamic page content generation and dynamic presentation. With these comprehensive, platform independent Java class libraries you can join together the disparate pieces of your business - data, applications and platforms - to form a coherent whole.\n<br />\nJava 2 Enterprise Edition - announced by Sun in June 1999 - makes Java an entire platform, not just another language and this is the first book that seriously covers it.',98,5,'Y',2147483647,8,4,1,0.00,'N','Y',1,10.00,8.00,10.00,10,'N','N',0,0,'','','','N','N',1,'');
INSERT INTO xcart_products VALUES (65,'SKU65','New Masters of Flash',1,'',1.00,79.99,'\"New Masters of Flash\" is both global showcase and practical tutorial. Twenty of the planet\'s most awe-inspiring Flash designers share their influences, ideas and objectives in individual introductory essays.','<b>New Masters of Flash</b> is both global showcase and practical tutorial. Twenty of the planet\'s most awe-inspiring Flash designers share their influences, ideas and objectives in individual introductory essays. They then take the reader through a step-by-step tutorial explaining in detail how to create in Flash 5 the interfaces, applications and effects that they have made famous. On the accompanying CD, watch interviews with the designers, follow animated versions of the tutorials and download the FLAs for Flash 5 (F4 FLAs are also available from the support website). The author-designers are some of the most legendary Flash innovators currently working - from the US to Japan, Europe to South Africa: Yugo Nakamura, Joshua Davies, Manuel Clement, Irene Chan and Tomato\'s Joel Baumann together with fifteen other leading Flash practitioners. These are the designers who are expanding the horizons of interactive interface design with Flash. Join them.',94,6,'Y',2147483647,7,18,1,0.00,'N','Y',1,10.00,8.00,10.00,10,'N','N',0,0,'','','','N','N',1,'');
INSERT INTO xcart_products VALUES (64,'SKU64','Microsoft FrontPage 2000',1,'',1.00,154.65,'Microsoft FrontPage 2000 Web site creation and management tool is the quick, effective way for novices and experienced Web builders to create and manage professional, appealing Internet or intranet sites without knowing how to program. The Official Microsoft Frontpage 2000 Book provides an overview of the popular Web creation and management program and its processes, along with a reference section. Readers will learn to integrate various kinds of documents into a Web site, create sites within a workgroup, and use advanced features that would otherwise be beyond their abilities. Because it\'s designed for those with no previous Web page production background, this book helps users quickly and easily produce Web pages using new industrial-strength Web tools such as advanced HTML and data-receiving templates, as well as Web page creation and publishing via electronic mail. Clear instructions present the fundamentals and then build upon learned skills as more complicated issues unfold.','',100,0,'Y',2147483647,0,0,0,0.00,'N','Y',1,10.00,8.00,10.00,10,'N','N',0,0,'frontpage 2000','','','N','N',1,'');
INSERT INTO xcart_products VALUES (63,'SKU63','Adobe Photoshop 5.5 Classroom',1,'',1.00,61.27,'Classroom in a Book is a self-paced learning course in a hands-on workbook. Each book offers complete training based on real-world projects. Practical, focused lessons are designed to fit into busy schedules and teach the features of Adobe software quickly and easily. Included are both intermediate and advanced techniques for Windows and Macintosh. Using the specially created files on the CD-ROM, readers can work through the lessons and projects in the book.','This book is an excellent tool for learning how to use Adobe Photoshop 5 for Macintosh and Windows. The writers &mdash; actually a team from Adobe &mdash; guide you through the basic and advanced tasks of using the image editor and paint program to create and enhance a wide variety of photographs and images.\n<br /><br />\nYou don\'t need to know the previous versions of the program to get right to work. You use the practice files on the included hybrid CD-ROM as you follow the lessons throughout the book. There are step-by-step instructions, explanations of features, and plenty of illustrations to help you as you work, and each chapter has review questions and answers.\n\nFirst you learn the basics of the interface as you tour the options for selecting, using layers and filters, painting, retouching, and saving files. Next, you learn the essentials of opening files, navigating the interface, getting help, and creating layers and selections. After that the chapters get much more specific, teaching you how to use the paint, editing, and pen tools; work with selections, masks, channels, and layers; and apply photo-retouching techniques and special effects. You also learn how to combine graphics from Adobe Illustrator with those from Photoshop, prepare images for the Web, manage two-color print jobs, and fine-tune color preferences for ideal output. The projects involve both fine art and commercial art &mdash; everything from composite images to color-corrected photographs. Finally, you work with Adobe ImageReady 1.0, the new package for creating images and animations for the Web and other multimedia projects.\n<br /><br />\nA full-color section shows you the finished artwork from the various chapters, color models, and, in a few cases, the various versions of an image as you apply changes to it. This section also shows you how to use all the Toolbox tools, including the selection, paint, stamp, sharpen, sponge, pen, type, gradient, eyedropper, zoom, and measure tools. This section is particularly helpful for users who are trying to get up to speed with Photoshop\'s many features. This tutorial will take you well past basic interface issues and have you creating some pretty amazing images.',95,7,'Y',2147483647,3,2,0,0.00,'N','Y',1,10.00,8.00,10.00,10,'N','N',0,0,'photoshop, photoshop 5','','','N','N',1,'');
