INSERT INTO xcart_products VALUES (119,'SKU119','Modjo - Modjo',1,'',1.00,22.61,'It\'s often a long-term disadvantage, especially for dance acts, when a debut single enters the chart at No. 1. Rather than hurrying the release of their self-titled debut, Modjo, and cashing in with an album full of \"Lady (Hear Me Tonight)\" clones, the duo have instead opted to experiment with more diverse musical styles. Some of the tracks still retain a hint of that emerging \"Modjo sound\" (\"Rollercoaster,\" \"On Fire\"), but overall they successfully veer away from just being French house anthems. \"Peace of Mind\" and \"What I Mean\" are successful forays into pop-laced R&amp;B, while the album opener, \"Acknowledgement,\" is a Pet Shop Boys-style synth instrumental. The best track is undoubtedly \"No More Tears,\" an upbeat pop number that could have been recorded by Stevie Wonder. \"Saviour\'s Eyes\" is another funky little number, with a Jamiroquai-style arrangement and vocals strangely mimicking those of Level 42\'s Mark King.','It\'s often a long-term disadvantage, especially for dance acts, when a debut single enters the chart at No. 1. Rather than hurrying the release of their self-titled debut, Modjo, and cashing in with an album full of \"Lady (Hear Me Tonight)\" clones, the duo have instead opted to experiment with more diverse musical styles. Some of the tracks still retain a hint of that emerging \"Modjo sound\" (\"Rollercoaster,\" \"On Fire\"), but overall they successfully veer away from just being French house anthems. \"Peace of Mind\" and \"What I Mean\" are successful forays into pop-laced R&amp;B, while the album opener, \"Acknowledgement,\" is a Pet Shop Boys-style synth instrumental. The best track is undoubtedly \"No More Tears,\" an upbeat pop number that could have been recorded by Stevie Wonder. \"Saviour\'s Eyes\" is another funky little number, with a Jamiroquai-style arrangement and vocals strangely mimicking those of Level 42\'s Mark King.\n<br /><br />\n1. Acknowledgement<br />\n2. Chillin\'<br />\n3. Lady (Hear Me Tonight)<br />\n4. Too Good To Be True<br />\n5. Peace Of Mind<br />\n6. What I Mean<br />\n7. Music Takes You Back<br />\n8. No More Tears<br />\n9. Rollercoaster<br />\n10. On Fire<br />\n11. Savior Eyes<br />\n12. Lady (Acoustic Version)',100,0,'Y',2147483647,0,0,0,0.00,'N','Y',1,10.00,8.00,10.00,10,'N','N',0,0,'','','','N','N',1,'');
INSERT INTO xcart_products VALUES (120,'SKU120','Lenny Kravitz - Lenny',1,'',1.00,22.61,'Lenny Kravitz is known for proudly wearing his influences on his sleeve, but on his sixth album it\'s clear Kravitz has at last honed a sound he can call his own. Mixing hard rock and ballads, <em>Lenny</em> kicks in with the blistering \"Battlefield of Love,\" a solid rocker with a funk groove. The retro \"If I Could Fall in Love\" displays a touch of psychedelia, while the Lennonesque \"God Save Us All\" is bluesy and uplifting. The success of \"Again,\" the smash single from his 2000 hits package, appears to have registered with Kravitz, who surfaces a new crop of midtempo ballads here - all far stronger than \"Again.\" \"Yesterday Is Gone (My Dear Kay)\" is a finely crafted tune on it\'s own, yet Kravitz experiments with atypical sounds. The soulful \"Stillness of Heart\" builds with acoustic guitars and layered harmonies, concluding with a lovely string arrangement. And \"You Were in My Heart\" mixes synth loops over solid rhythms and a haunting melody. Lenny may seem like an oddly nondescript title, but it\'s apt; these 12 songs simply sound like the work of Lenny Kravitz.','Lenny Kravitz is known for proudly wearing his influences on his sleeve, but on his sixth album it\'s clear Kravitz has at last honed a sound he can call his own. Mixing hard rock and ballads, <em>Lenny</em> kicks in with the blistering \"Battlefield of Love,\" a solid rocker with a funk groove. The retro \"If I Could Fall in Love\" displays a touch of psychedelia, while the Lennonesque \"God Save Us All\" is bluesy and uplifting. The success of \"Again,\" the smash single from his 2000 hits package, appears to have registered with Kravitz, who surfaces a new crop of midtempo ballads here - all far stronger than \"Again.\" \"Yesterday Is Gone (My Dear Kay)\" is a finely crafted tune on it\'s own, yet Kravitz experiments with atypical sounds. The soulful \"Stillness of Heart\" builds with acoustic guitars and layered harmonies, concluding with a lovely string arrangement. And \"You Were in My Heart\" mixes synth loops over solid rhythms and a haunting melody. Lenny may seem like an oddly nondescript title, but it\'s apt; these 12 songs simply sound like the work of Lenny Kravitz.\n<br /><br />\n1. Battlefield Of Love<br />\n2. If I Could Fall In Love<br />\n3. Yesterday Is Gone (My Dear Kay)<br />\n4. Stillness Of Heart<br />\n5. Believe In Me<br />\n6. Pay To Play<br />\n7. A Million Miles Away<br />\n8. God Save Us All<br />\n9. Dig In<br />\n10. You Were In My Heart<br />\n11. Bank Robber Man<br />\n12. Let\'s Get High',100,0,'Y',2147483647,0,0,0,0.00,'N','Y',1,10.00,8.00,10.00,10,'N','N',0,0,'','','','N','N',1,'');
