INSERT INTO xcart_products VALUES (124,'SKU124','Mariah Carey - Glitter',1,'',1.00,27.79,'Despite songbird Mariah Carey\'s emotional troubles during the release of the soundtrack to Glitter, she has never sounded giddier. In keeping with the semiautobiographical flick\'s 1980s time frame, <em>Glitter</em> mines the rich and rhythmic fields of discofied funk and club-friendly jams, and Carey soars on thumping covers of Indeep\'s \"Last Night a DJ Saved My Life\" (featuring DJ Clue, Busta Rhymes, and New Jack of the moment Fabolous), and Cherrelle\'s skittish, synth-soaked love song \"Didn\'t Mean to Turn You On\", which in a nice touch, is revisited by its production auteurs Jimmy Jam and Terry Lewis. Also well worth a listen is \"All My Life\", a sweet and nasty Rick James track that finds Mariah looser than she\'s ever been; it\'s on those uptempo jams that Mariah is all sass and sex. Unfortunately, she loses the mood on the by-the-numbers ballads, which slow the party down just as it\'s getting hot.','Despite songbird Mariah Carey\'s emotional troubles during the release of the soundtrack to Glitter, she has never sounded giddier. In keeping with the semiautobiographical flick\'s 1980s time frame, <em>Glitter</em> mines the rich and rhythmic fields of discofied funk and club-friendly jams, and Carey soars on thumping covers of Indeep\'s \"Last Night a DJ Saved My Life\" (featuring DJ Clue, Busta Rhymes, and New Jack of the moment Fabolous), and Cherrelle\'s skittish, synth-soaked love song \"Didn\'t Mean to Turn You On\", which in a nice touch, is revisited by its production auteurs Jimmy Jam and Terry Lewis. Also well worth a listen is \"All My Life\", a sweet and nasty Rick James track that finds Mariah looser than she\'s ever been; it\'s on those uptempo jams that Mariah is all sass and sex. Unfortunately, she loses the mood on the by-the-numbers ballads, which slow the party down just as it\'s getting hot.\n<br /><br />\n1. Loverboy Remix<br />\n2. Lead The Way<br />\n3. If We<br />\n4. Didn\'t Mean To Turn You On<br />\n5. Don\'t Stop (Funkin\' 4 Jamaica)<br />\n6. All My Life<br />\n7. Reflections (Care Enough)<br />\n8. Last Night A DJ Saved My Life<br />\n9. Want You<br />\n10. Never Too Far<br />\n11. Twister<br />\n12. Loverboy',100,0,'Y',2147483647,0,0,0,0.00,'N','Y',1,10.00,8.00,10.00,10,'N','N',0,0,'','','','N','N',1,'');
