INSERT INTO xcart_products VALUES (141,'SKU141','Acer TravelMate 212T',1,'',1.00,2034.09,'The freedom to leave your desk behind without leaving your computer. The freedom to do what you want, where you want. The freedom of an all-in-one mobile system. Acer\'s new TravelMate 210 series of mobile PCs provides you with all you need to stay productive at home, at the office, or in the classroom. With the TravelMate 210 series you have the freedom to get up and go! An affordable mobile system that has everything you need - the dream is now a reality!The TravelMate 210 series gives every computer user the opportunity that they have been waiting for, the chance to get mobile. Featuring the latest Intel processors, a high-quality TFT display, and a high-capacity hard drive, the TravelMate 210 series provides an economical solution that meets all your computing requirements. The TravelMate 210 series eliminates the need for annoying add-on modules that can easily get lost or damaged while moving around. The smart all-in-one design means that being mobile has never been easier!','The freedom to leave your desk behind without leaving your computer. The freedom to do what you want, where you want. The freedom of an all-in-one mobile system. Acer\'s new TravelMate 210 series of mobile PCs provides you with all you need to stay productive at home, at the office, or in the classroom. With the TravelMate 210 series you have the freedom to get up and go! An affordable mobile system that has everything you need - the dream is now a reality!The TravelMate 210 series gives every computer user the opportunity that they have been waiting for, the chance to get mobile. Featuring the latest Intel processors, a high-quality TFT display, and a high-capacity hard drive, the TravelMate 210 series provides an economical solution that meets all your computing requirements. The TravelMate 210 series eliminates the need for annoying add-on modules that can easily get lost or damaged while moving a