INSERT INTO xcart_products VALUES (175,'SKU175','Microsoft Flight Simulator 2000',1,'',1.00,97.50,'Microsoft Flight Simulator 2000 is the latest version of Microsoft\'s highly realistic, graphically advanced flight simulat or, the best-selling PC flight simulation ever produced. Microsoft has worked closely with leaders in the aviation industry: aircr aft manufacturers, training and pilot organizations, data suppliers, and flight instructors to make Flight Simulator 2000 Professi onal Edition as real as it gets.','<em>Microsoft Flight Simulator 2000</em> is the latest version of Microsoft\'s highly realistic, graphically advanced flight simulat or, the best-selling PC flight simulation ever produced. Microsoft has worked closely with leaders in the aviation industry: aircraft manufacturers, training and pilot organizations, data suppliers, and flight instructors to make Flight Simulator 2000 Professional Edition as real as it gets.\n<br /><br />\n<em>Flight Simulator 2000</em> is the civilian flight simulator for the new millennium. Built on a foundation of realism that spans over 17 years, Flight Simulator 2000 is the largest leap forward in Microsoft Flight Simulator history. For the first time ever, we are offering a \"Professional\" Edition of Microsoft Flight Simulator in addition to Flight Simulator 2000. The Professional version ofF light Simulator 2000 is geared to Flight Simulator enthusiasts, real pilots, those who want \"more features and more content\" and those who are interested in using <em>Flight Simulator 2000</em> as a PC-based flight training and proficiency aid.',100,4,'Y',2147483647,0,0,0,0.00,'N','Y',1,10.00,8.00,10.00,10,'N','N',0,0,'','','','N','N',1,'');
INSERT INTO xcart_products VALUES (183,'SKU183','Real chafer beetle decoration',1,'',0.50,10.49,'A great attention getter.<br /><br />\nA real green chafer beetle encased in acrylic. Metallic green against a bright green background. Beetle is viewable from both sides. Excellent color and detail. Stands 3 inches tall. Comes with an attractive gift box. Great for any nature lover. Will make a great conversation piece.\n','',6,0,'Y',1144837261,3,0,0,0.00,'N','Y',1,10.00,8.00,10.00,2,'N','N',0,0,'','','','N','',1,'');
INSERT INTO xcart_products VALUES (191,'SKU191','Baldur\'s Gate 2 Expansion: Throne of Bhaal',1,'',1.00,50.63,'In the final chapter of the Bhaal saga, return to Baldur\'s Gate II: Shadows of Amn and unravel the mysteries of a dangerous new dungeon - Watcher\'s Keep. Continue with an exhilarating new adventure when you explore the unseen lands of Tethyr, encounter fierce villains, and gain powerful high-level abilities as you achieve your ultimate destiny in...Baldur\'s Gate II: Throne of Bhaal.','<em>Baldur`s Gate II: Throne of Bhaal</em> takes players through an all-new storyline rich with intrigue and treachery as they unravel the mysteries of the Dungeon of Watcher`s Keep and explore other new areas such as the City of Saradush, the Fortified Monastery of Amkethran, Sendai`s Underdark Fortress and the player`s own Planar Stronghold. Throughout their journey, characters may reach up to level 40, made possible with a raised experience cap of 8 million points, quite possibly the highest level ever achieved by characters in any Advanced Dungeons &amp; Dragons computer game. Also included in the quest are over 40 new powerful high-level spells and abilities. The Wild Mage Character Kit will also be included to the already extensive class list allowing gamers to create a powerful new character able to cast spells with very unpredictable results. Baldur\'s Gate II players will be pleased to hear that the Dungeon of Watchers Keep (the add-in section contained within the Throne of Bhaal expansion pack) is fully playable either while questing through their Baldur\'s Gate II: Shadows of Amn adventure or while completing the Child of Bhaal Saga (as part of the add-on section of the Throne of Bhaal expansion). Baldur`s Gate II: Throne of Bhaal has shipped to retail for Windows 95/98-based computers and gamers will need to own the original Baldur`s Gate II: Shadows of Amn in order to play.',44,31,'Y',2147483647,8,56,0,0.00,'N','Y',1,10.00,8.00,10.00,10,'N','N',0,0,'','','','N','N',1,'');
