INSERT INTO xcart_products VALUES (89,'SKU89','Tatty Teddy bear',1,'',0.50,11.30,'An adorable grey bear with the blue nose and patches is waiting to share all your love.\n<br /><br />\nLet a classic <i>Me to You</i> Tatty Teddy touch the heart of someone you know. Floppy and huggable, this plush bear has a lot of charisma and will be a companion in good times and bad. Whatever the occasion, Tatty Teddy gets the sentiment just right. 6 1/4 inch tall. Surface washable.\n','',20,0,'Y',1144836325,0,0,0,0.00,'N','Y',1,10.00,8.00,10.00,4,'N','N',0,0,'teddy','','','N','N',1,'');
INSERT INTO xcart_products VALUES (90,'BARBIE001','The Swan Barbie',1,'',1.00,32.00,'The Swan Barbie depicts the style, beauty, and grace of the elegant bird that she pays homage to. Her off-white gown has a fitted bodice with beaded shoulder straps and a flowing skirt with a tuller petticoat underneath. A plume of black and white feathers decorates the front of her skirt, while a second tuft springs up from the back of the bodice. Her black hair is fashioned in a sophisticated, upswept style and topped with a beaded tiara and yet more feathers. Her feet are shod in matching off-white slippers, making one wonder if this Barbie didn\'t step right out of \"Swan Lake.\"\n<br /><br />\nMeant for collection rather than play, a stand is included for displaying this beautiful doll.','',100,0,'Y',2147483647,0,0,0,0.00,'N','Y',1,10.00,8.00,10.00,10,'N','N',0,0,'swan, barbie','','','N','N',1,'');
INSERT INTO xcart_products VALUES (91,'SKU91','Alphabet Apple',1,'',1.00,23.99,'The Alphabet Apple by V-Tech is designed to let preschoolers take a good bite out of learning their letters. Insert two AA batteries (not included) into the sturdy-plastic, portable unit, and youngsters can slide the \"worm\" in the apple to select one of five settings. The first four settings instruct kids in letter recognition and sounds, complete with letter-finding games using the push buttons. A fifth option offers nine different melodies that play (regrettably, at a nonadjustable volume) at the press of a key. With its colorful, kid-friendly design, the Alphabet Apple provides the seed for a solid core of learning.','',100,0,'Y',2147483647,2,0,2,0.00,'N','Y',1,10.00,8.00,10.00,10,'N','N',0,0,'','','','N','N',1,'');
