INSERT INTO xcart_products VALUES (112,'SKU112','Scary Movie 2',1,'',1.00,39.77,'The Wayans Brothers return with another horror-flick parody, this one taking shots at The Exorcist, Hannibal, and House on Haunted Hill, along with non-horror fare like Charlie\'s Angels. In addition to gags (and I do mean gag) about innumerable bodily functions, there are slyer jabs at Thomas Jefferson and Raging Bull. As in Scary Movie, the strongest humor comes from making fun of the inane behavior of characters in horror movies. Assisting Shawn and Marlon Wayans are Anna Faris, Kathleen Robertson (in the Carmen Electra role, providing the T&amp;A), and David Cross, as well as Tori Spelling, Chris Elliott, James Woods (as an exorcist with bowel trouble), Andy Richter, and poor Tim Curry, who probably never thought his career would come to this.','\'No Mercy. No Shame. No Sequel\' was the tag-line for \"Scary Movie\". In one sense, at least, they lied. The Wayans team is back with more of the same, this time targeting supernatural thrillers.\n<br /><br />\nTim Curry plays a college professor who bribes a group of pupils with A-grades to spend the weekend in a haunted house, but the story really isn\'t the point here. As you might expect, the plot is largely a combination of the plots of the films it parodies, which include \"What Lies Beneath\", \"Hannibal\", and \"Hollow Man\".\n<br /><br />\nIt was presumably the pre-title sequence, crammed full of urination, defecation, and projectile vomiting, which gave the film its 18 certificate. From then on, while many of the gags remain close to the bone, they\'re more cheeky and smutty than offensive.\n<br /><br />\nIn an attempt to appeal to a more genteel audience, the Wayans brothers (Keenan, Marlon, and Shawn) also dig their teeth into the likes of \"Charlie\'s Angels\", and even The Weakest Link. A handful of jokes also shock with their unexpected cleanliness. If not belly laughs, there\'ll be frequent nods of acknowledgement.\n<br /><br />\nUnlike the father of all spoof movies \"Airplane\" - but like \"Scary Movie 2\" \'s wheelchair-bound mad scientist - this film can\'t really stand on its own two feet. It relies heavily on its audience having seen most of the films being aped. It can be funny to see one set of actors doing the same as you\'ve seen another set of actors doing, and even funnier still when there\'s a wicked twist thrown in to end the sequence, but if you haven\'t seen the target film, not only is it not funny, it becomes totally pointless.',100,5,'Y',2147483647,1,0,0,0.00,'N','Y',1,10.00,8.00,10.00,10,'N','N',0,0,'','','','N','N',1,'');
INSERT INTO xcart_products VALUES (87,'SKU87','Barbie as Snowflake',1,'',1.00,19.97,'Barbie doll gets a standing ovation as the beautiful Snowflake from the beloved ballet, \"The Nutcracker\". This doll is fourth in the Classic Ballet Series. Barbie looks breathtaking in a glittering, white satin and blue tulle ballerina costume with a delicate snowflake pattern. She wears shimmery tights and pretty, blue toe shoes. Her crowning touch is a silvery tiara. Barbie has special legs, so girls can really pose her in \"on-toe\" ballet positions.','',100,2,'Y',2147483647,0,0,0,0.00,'N','Y',1,10.00,8.00,10.00,10,'N','N',0,0,'','','','N','N',1,'');
INSERT INTO xcart_products VALUES (93,'SKU93','Lord of the Rings Board Game',1,'',1.00,46.65,'Here\'s your chance to prove you are worthy to save Middle Earth. Enter the world envisioned in J.R.R. Tolkien\'s book Lord of the Rings and become a member of the Fellowship. The goal of the game is to stop the Dark Lord Sauron from winning back the magic Ring, which Frodo has inherited and which Sauron would use to forever enslave the land.','',80,9,'Y',2147483647,15,23,3,0.00,'N','Y',1,10.00,8.00,10.00,10,'N','N',0,0,'lord of the rings','','','N','N',1,'');
INSERT INTO xcart_products VALUES (94,'SKU94','Monopoly Junior',1,'',1.00,14.65,'Just like its big brother, Monopoly Jr. is big-time fun for everyone! Spend a day at the amusement park. Ride the roller coaster, bumper cars, or Ferris wheel. How about a game of miniature golf or a visit to the haunted house? It\'s simple - set up ticket booths on as many boardwalk amusements as possible, then build your fortune collecting the entrance fees as other players land on your properties. If someone else already owns an amusement, you pay up. Watch out - if one player owns both amusements of the same color, you must pay them double! So have some fun. And don\'t forget - pass GO, collect $2.','',100,0,'Y',2147483647,0,0,0,0.00,'N','Y',1,10.00,8.00,10.00,10,'N','N',0,0,'','','','N','N',1,'');
INSERT INTO xcart_products VALUES (105,'SKU105','The Fast and the Furious',1,'',1.00,46.47,'An undercover cop infiltrates an underworld subculture of Los Angeles street racers looking to bust a hijacking ring, and soon begins to question his loyalties when his new street racing friends become the prime suspects.','A guilty pleasure with excess horsepower, The Fast and the Furious efficiently combines time-honored male fantasies (hot cars, hot women, hot action) into a vacuous plot of crystalline purity. It\'s trash, but it\'s fun trash, in which a hotshot Los Angeles cop named Brian (Paul Walker) infiltrates a gang of street racers suspected of fencing stolen goods from hijacked trucks. The gang leader is Dom (Vin Diesel), ex-con and reigning king of the street racers, who lives for those 10 seconds of freedom when his high-performance \"rice rocket\" (a highly modified Asian import) hurtles toward another quarter-mile victory. Racing is street theater for a lawless youth subculture, and Dom is a star behind the wheel - charismatic, dangerous, and protective toward his sister Mia (Jordana Brewster), who\'s attracted to Brian as the newest member of Dom\'s car-crazy team.\n<br /><br />\nDirector Rob Cohen treats this like Roman tragedy for MTV junkies, pushing every scene to adrenaline-pumping extremes; when his camera isn\'t caressing a spectrum of nitrous oxide-enhanced dream machines, it\'s ogling countless slim \'n\' sexy race babes. The undercover-cop scenario cheaply borrows the split-loyalty theme perfected in Donnie Brasco; a rival Asian gang adds mystery and menace; and digital trickery is cleverly employed to explore the fuel-injected innards of the day-glo racecars. It\'s about as substantial as a perfume ad, but just as alluring, and for heavy-metal maniacs of any age, Diesel\'s superblown \'69 Charger proves that Detroit muscle never goes out of style.',100,2,'Y',2147483647,0,0,0,0.00,'N','Y',1,10.00,8.00,10.00,10,'N','N',0,0,'','','','N','N',1,'');
