INSERT INTO xcart_products VALUES (109,'SKU109','Bridget Jones\'s Diary',1,'',1.00,34.53,'A British woman is determined to improve herself while she looks for love in a year in which she keeps a personal diary.','Bridget Jones (Renee Zellweger) is an average woman struggling against her age, her weight, her job, her lack of a man, and her many imperfections. As a New Year\'s Resolution, Bridget decides to take control of her life, starting by keeping a diary in which she will always tell the complete truth. The fireworks begin when her charming though disreputable boss (Hugh Grant) takes an interest in the quirky Miss Jones and the ups and downs of their ill-fated relationship prove hilarious and touching at once. Thrown into the mix are Bridget\'s band of slightly eccentric friends and a rather disagreeable acquaintance (Colin Firth) who Bridget cannot seem to stop running into or help finding quietly attractive.',100,2,'Y',2147483647,0,0,0,0.00,'N','Y',1,10.00,8.00,10.00,10,'N','N',0,0,'','','','N','N',1,'');
INSERT INTO xcart_products VALUES (108,'SKU108','Moulin Rouge',1,'',1.00,46.47,'A poet falls for a beautiful courtesan whom a jealous duke covets in this stylish musical, with music drawn from familiar 20th century sources.','Christian, a young wannabe Bohemian poet living in 1899 Paris, defies his father by joining the colorfully diverse clique inhabiting the dark, fantastical underworld of Paris\' now legendary Moulin Rouge. In this seedy but glamorous haven of sex, drugs and newly-discovered electricity, the poet-innocent finds himself plunged into a passionate but ultimately tragic love affair with Satine, the club\'s highest paid star and the city\'s most famous courtesan. Their romance is played out against the infamous club - a meeting place of high life and low, where slumming aristocrats and the fashionably rich mingled with workers, artists, Bohemians, actresses and courtesans.',100,2,'Y',2147483647,0,0,0,0.00,'N','Y',1,10.00,8.00,10.00,10,'N','N',0,0,'','','','N','N',1,'');
INSERT INTO xcart_products VALUES (114,'SKU114','Heartbreakers',1,'',1.00,56.82,'Max (Weaver) and Page (Hewitt) are a mother and daughter con team. Max seduces wealthy men into marrying her, then Page seduces them into infidelity so Max can rake them over the divorce court coals. And then it\'s on to the next victim.','In David Mirkin\'s <em>Heartbreakers</em>, a sweet comedy which plays like a lighthearted version of <em>The Grifters</em>, Sigourney Weaver and Jennifer Love Hewitt are a mother/daughter pair of con artists. Although they scam for everything from food to gas, their specialty is marriage settlements.\n<br /><br />\nWhen we first meet our connivers, Max (Weaver) is marrying Dean Cumanno (Ray Liotta), a respectable New Jersey chop shop owner. When his new secretary, Page (Hewitt), entices him into a little oral sex, his wife of 18 hours arrives to catch them in the act. \"Honey, it isn\'t what it looks like here,\" Dean tries to explain to Max. \"Her hair got stuck in my zipper.\" Cut to the lawyers office in which Max leaves with a chunk of cash and one of Dean\'s freshly built Mercedes. \n<br />Although they look like Mutt and Jeff with their dramatic height difference, Weaver and Hewitt are a convincing and funny choice as relatives and rivals. The rebellious Page thinks that Max treats her like a little kid, and Max thinks that Page isn\'t ready to go solo like she plans. Their confidence games are quite believable. Max looks like someone who would sweep you off your feet into an early marriage proposal. And Page, with her lovely legs, micro skirts and ERIN BROCKOVICH-type bras that push her generous breasts skyward, looks like someone who might tempt even the most married of married men. In short, the deliciously caustic chemistry between Weaver and Hewitt is the best part of the movie.\n<br /><br />\nThe weakest link, other than the excessive running time, is the supporting cast. Although Liotta is impressive, most of the others are either underutilized or miscast. Anne Bancroft delivers a wooden performance as an IRS agent who forces the two crooks into their most ambitious scam ever. Jason Lee (<em>Almost Famous</em>), who isn\'t given much to do as the only guy with whom Page ever falls in love, phones in his performance. \n<br /><br />\nAs a clich of a rich old geezer with yellow teeth, Gene Hackman coughs his way through his part as William B. Tensy, a tobacco company CEO with millions to burn. If he will just live long enough to tie the knot with Max, she and her daughter will be able to pay their back taxes and live on easy street for the rest of their lives. But Page hates the whole idea. \"I\'m not dating the walking dead\", she bitterly informs her mother, who replies, \"we better work fast\".\n<br /><br />\nIn Tensy\'s most memorable line, he reveals the secret of what really turns on a tobacco millionaire - \"smoke billowing out of a woman\'s hot, red nostrils\".<br />\nThe image almost makes the unflappable, non-smoking Max gag. Gag isn\'t something you will do while watching this brightly written comedy.<br />\n<em>Heartbreakers</em> isn\'t any laugh riot, but it is entertaining fun. It\'s the sort of picture that will leave you with a smile on your face and a feeling that you got your money\'s worth.',100,0,'Y',2147483647,0,0,0,0.00,'N','Y',1,10.00,8.00,10.00,10,'N','N',0,0,'','','','N','N',1,'');
