INSERT INTO xcart_products VALUES (126,'SKU126','Manu Chao - Proxima Estacion Esperanza',1,'',1.00,26.07,'Manu Chao incorporates the Spanish, English and French languages into fun, infectious songs that are bound to catch your ear. With his solo album \"Clandestino\", the former leader of the band Lo Mano Negra uses multicultural sounds to compose tunes like \"Lagrimas de Oro\" and \"Je ne T\'Aime Plus\" which are only two of the quirkiest songs on the album (if you translate them, they\'re even more amusing). Each song tells a cool story using funky lyrics in more than one language. And, despite a few allusions, he does so without using expletives. With each listen, you will discover even more in each song.\n<br /><br />\nHis follow-up album, \"Proxima Estacion: Esperanza\" is another melting pot of tunes that even combines Spanish and French phrases into a single refrain in the whimsical \"Me Gustas Tu\". Using three languages has influenced not only the lyrics, but also the fun sounds and rhythms of Chao\'s tunes. Yet, a beneficial quirk is that you do not have to be a linguist to get the overall meaning of his songs.\n<br /><br />\nWhether or not Latin music is your favorite, Manu Chao is an awesome artist. Check him out.','',100,0,'Y',2147483647,0,0,0,0.00,'N','Y',1,10.00,8.00,10.00,10,'N','N',0,0,'','','','N','N',1,'');
