INSERT INTO xcart_products VALUES (131,'SKU131','Palm OS Handera 330',1,'',1.00,688.51,'HandEra 330 is a high-end, flexible Palm OS-based handheld.','Operating System: Palm OS version 3.5.2<br />\nProcessor: 33 MHz Motorola Dragonball VZ<br />\nMemory: 8 MB (2MB Flash ROM + 8MB RAM)<br />\nDisplay: 240 x 320 pixel 16 Gray scale - Active area 2.2 x 2.9 in. (55 x 73 mm)<br />\nSize: 4.7 x 3.2 x 0.7 in. (121 x 81 x 17 mm)<br />\nWeight: 5.9 oz. (167 g) with AAA alkaline batteries<br />\nInfrared port (lrDA v1.2) up to 115k baud<br />\nOne CompactFlash Type I/II card slot<br />\nOne Secure Digital (SD) or MultiMediaCard slot<br />\nSerial Cradle<br />\nBattery: 4 AAA\'s',100,0,'Y',2147483647,2,0,3,0.00,'N','Y',1,10.00,8.00,10.00,10,'N','N',0,0,'','','','N','N',1,'');
INSERT INTO xcart_products VALUES (132,'SKU132','Palm OS m125',1,'',1.00,453.41,'Expand your horizons and organize your busy schedule with the Palm m125 handheld. With 8 MB of memory, a USB HotSync cradle, and a new expansion card slot, the curvy, sleek Palm m125 offers lots of computing power and versatility. You\'ll be able to add more powerful applications and store thousands of memos, appointments, addresses, and to-do items.','Processor: Motorola VZ Dragonball 33 Mhz<br />\nOperating System: Palm OS 4.0<br />\nMemory: 8MB RAM<br />\nDisplay: 160x160 pixel, 16 gray scale LCD<br />\nSD/MultiMediaCard Expansion Slot<br />\nPower: 2 AAA Batteries<br />\nCommunications: USB and IR port<br />\nSize and weight: 4.82 x 3.1 x .87 in. / 5.31 oz',91,8,'Y',2147483647,17,12,1,0.00,'N','Y',1,10.00,8.00,10.00,10,'N','N',0,0,'','','','N','N',1,'');
