INSERT INTO xcart_products VALUES (135,'SKU135','Psion netBook',1,'',1.00,2468.24,'A highly portable laptop replacement machine running EPOC ER5, allowing you to take your work with you just about everywhere without having to search for an power outlet or a forklift to carry it around; hardware design includes features making the unit especially good for enterprise/business use.','netBook, from Psion Enterprise Computing, is the first of a range of mobile products targeted at Enterprise computing applications. Wherever your mobile application takes you the netBook is ready to provide instant access to your applications, data and the Internet. These are just some of the segments that gain productivity, efficiency and cost benefitsfrom using effective mobile computing solutions: Field Sales and Support Healthcare and Pharmaceutical Financial Services, Insurance and Banking Transport, Logistics andService. netBook offers you the best of both worlds - sub-notebook format \"instant-on\" portable computing, combined with the industry standard Java platform for enterpriseapplication deployment. netBook is for anywhere you need mobile access to data, and its stylish but practical casing means that it is equally at home outside in field service, ona manufacturing line, in a hospital or on a desk. netBook provides a complete range of communications options. A built in RS232 port interfaces to external devices, including PCs,while the PC Card slot supports Ethernet cards for LAN access. Third party GSM cards allow wireless Internet access, and a variety of available modem cards interface to PSTN andISDN networks. A built in fast IrDA port supports wireless interface to GSM phones, IrDA equipped printers, and device-to-device communications. The benefits of mobile computingare widely recognized, but proprietary software and custom development environments have slowed deployment. netBook includes a high quality, high performance implementation of SunMicrosystems\' Java Virtual Machine. Java technology offers rapid application deployment, application re-use and compatibility across the enterprise from hand-held to server. UntilnetBook the notebook PC has been the only solution for mobile Java applications. Now you can have the power of Java technology combined with the \"instant on\", ease of use,reliability and robustness of the netBook solution. netBook can reduce your costs, accelerate deployment and benefit your organization. In applications as diverse as wirelessField Sales access for Internet and intranet data, rugged mobile use in a service or manufacturing organization, or home banking/shopping applications netBook provides a newparadigm for mobile computing.\n<br /><br />\n<b>Technical Datasheet:</b>\n<br /><br />\n<table cellspacing=\"2\" cellpadding=\"0\" border=\"0\">\n<tr><td>Processor</td><td>Intel SA-1100 StrongARM 190 MHz</td></tr>\n<tr><td>Internal RAM</td><td>32 MB, expandable to 64 MB Internal DRAM</td></tr>\n<tr><td>Card Slot</td><td>One Compact Flash (CF) Type I/II 3.3V/5V<br />The CF Card slot supports conventional Compact Flash Cards as well as the IBM MicroDrive (up to 34 MB of storage(!), both with Live Insertion and Removal<br />One PC Card (Type I/II 3.3V/5V) with serial, modem, Ethernet, and Flash ATA support (Ethernet support is not available now but is promised in 2Q 2000)</td></tr>\n<tr><td>Display</td><td>7.7\" 640x480 color back-lit STN LCD panel</td></tr>\n<tr><td>Pointing device</td><td>Pen and digitizer (touchscreen)</td></tr>\n<tr><td>Keyboard</td><td>58-key standard layout keyboard</td></tr>\n<tr><td>Sound</td><td>12 bit digital sound with speaker and microphone</td></tr>\n<tr><td>Battery</td><td>Li-Ion battery with lithium cell, (CR2032) backup</td></tr>\n<tr><td>Ports</td><td>External expansion RS232 serial port to 115 kbit/sec IrDA 1.1, 115 kbit/sec and 4 Mbit/sec</td></tr>\n<tr><td>Docking</td><td>Optional flatbed docking station provides power and RS232 communications EPOC is loaded at cold power up into RAM from CF card or serial port. The OS is software upgradeable and may be configured to implement some or all of the supplied applications. User defined applications may be added (the Series 7 OS is on an OS Mask ROM module)</td></tr>\n<tr><td>Utilities</td><td>Time, Alarms, Calculator, and Voice Recorder PIM: Cotter, Contacts, Agenda, and Data</td></tr>\n<tr><td>Desktop Software</td><td>Word word processor and Sheet Spreadsheet</td></tr>\n<tr><td>Communication Software</td><td>Messaging, Fax, E-mail, and Web Internet browser</td></tr>\n<tr><td>E-mail support</td><td>SMITE, Internet POP-3, and IMAP-4</td></tr>\n<tr><td>Web Support</td><td>HTML 3.2, HTTP/1.1, frames, Java applets, GIF/JPEG graphics formats (but not JavaScript)</td></tr>\n</table>',100,1,'Y',2147483647,0,0,0,0.00,'N','Y',1,10.00,8.00,10.00,10,'N','N',0,0,'','','','N','N',1,'');
INSERT INTO xcart_products VALUES (138,'SKU138','Compaq iPAQ H3130',1,'',1.00,793.98,'A stylish Pocket PC with an excellent monochrome screen.','The Compaq iPAQ H3130 Pocket PC is a fine looking unit, identical to its bigger brother the H3630 except for the control buttons, which are matt black rather than chrome effect. The other most noticeable difference is that the H3130 sports a monochrome LCD. The image, which has a 240 x 320 pixel resolution, is extremely crisp, which cannot be said of many colour screens of this size. Holding the on/off button activates the back light, which works well in poorly lit environments.\n<br /><br />\nFollowing its bigger sibling, an Intel StrongARM SA1110 processor drives the unit along at a respectable 206Mhz. The memory is half that of the colour version at 16Mb, a bit of a shame as 32Mb is common on other Pocket PCs. An expansion slot sits on the bottom for upgrade to the bulky proprietary expansion packs, allowing options such as the addition of Compact Flash or a PC card connector.\n<br /><br />\nThe synchronisation cradle allows you to charge the unit as well as synchronise information with your PC. The cable is serial rather than USB. Operating the H3130 has the feel of using the full-blown Windows environment, although a touch screen is used as an interface.\n<br /><br />\nThere is a character recognition option for written input, although with a miniature touch keyboard on screen, you can choose to stick with what you know. All the usual programs are bundled, including pocket versions of Word, Excel and Money.\n<br /><br />\nOverall, this is an aesthetically pleasing, easy-to-use Pocket PC. The monochrome screen is excellent and certainly does not make this a lesser unit for its inclusion. The price tag is hefty, especially when compared to the monochrome equivalents from Handspring and Palm, but it\'s cheaper than the colour version.',100,2,'Y',2147483647,3,0,1,0.00,'N','Y',1,10.00,8.00,10.00,10,'N','N',0,0,'','','','N','N',1,'');
INSERT INTO xcart_products VALUES (143,'SKU143','Acer TravelMate 354TE',1,'',1.00,4433.33,'Business leaders know that first-class performance and excellent communication skills are the key attributes for any successful professional. The TravelMate 350 series of ultraportable mobile PCs, packed with the latest mobile technology, delivers outstanding performance and reliability. With a rugged and stylish ultraslim design, cutting-edge communications and connectivity options, unmatched security, and an intelligent range of user-friendly features, the TravelMate 350 series is the ideal choice for business professionals who need a computer that is light in weight, but strong in capabilities.','Business leaders know that first-class performance and excellent communication skills are the key attributes for any successful professional. The TravelMate 350 series of ultraportable mobile PCs, packed with the latest mobile technology, delivers outstanding performance and reliability. With a rugged and stylish ultraslim design, cutting-edge communications and connectivity options, unmatched security, and an intelligent range of user-friendly features, the TravelMate 350 series is the ideal choice for business professionals who need a computer that is light in weight, but strong in capabilities.\n<br /><br />\n<b>Specifications:</b><br />\nPentium PIII 850 Mhz Processor<br />\n13.3\" TFT (XGA) Display<br />\n128Mb RAM<br />\n20Gb Hard Drive<br />\nExternal 24xCD-Rom Floppy Disc Drive Combo<br />\nInternal 56K V90 Modem<br />\n128 Bit AGP Graphics Accelerator<br />\n4 8Mb SGRAM (Video Memory)<br />\nInternal Intel 10 100 LAN<br />\nWindows 98 ME<br />\nLi-Ion Battery (3 Hours)<br />\nWeight 1.8 Kg',100,0,'Y',2147483647,2,0,0,0.00,'N','Y',1,10.00,8.00,10.00,10,'N','N',0,0,'','','','N','N',1,'');
INSERT INTO xcart_products VALUES (144,'SKU144','Nikon Coolpix 880',1,'',1.00,906.67,'This time last year Nikon were readying the Nikon Coolpix 800, a quick progression from the Coolpix 700, which in turn had taken the guts of the 950, made the body smaller, removed the swivel and added a fixed (in the case of the 700) and a 2x zoom lens (in the case of the 800). So it was fairly easy to predict that Nikon would do something similar this year. Obviously they\'ve skipped the Coolpix 770 as it wouldn\'t be a huge seller... Instead they\'ve gone straight for the 880 which is essentially the guts and imager from the 990 in a redesigned (fixed) case with a 2.5x optical zoom and some new features not found on the 990. This will be their main new digital product at Photokina 2000, Europe\'s biggest photography exhibition.','This time last year Nikon were readying the Nikon Coolpix 800, a quick progression from the Coolpix 700, which in turn had taken the guts of the 950, made the body smaller, removed the swivel and added a fixed (in the case of the 700) and a 2x zoom lens (in the case of the 800). So it was fairly easy to predict that Nikon would do something similar this year. Obviously they\'ve skipped the Coolpix 770 as it wouldn\'t be a huge seller... Instead they\'ve gone straight for the 880 which is essentially the guts and imager from the 990 in a redesigned (fixed) case with a 2.5x optical zoom and some new features not found on the 990. This will be their main new digital product at Photokina 2000, Europe\'s biggest photography exhibition.\n<br /><br />\nThe 880 also has a few features the 990 doesn\'t, most notably the SCENE modes which will make it easy for beginners and more advanced users alike to select a preset shooting mode which puts the camera into\n<br />the correct setup for shooting a particular scene. In addition to this it appears that the SCENE modes also apply differing colour / contrast settings to achieve a certain \"look\" depending on which SCENE you\'ve chosen. Scene shooting modes provided:\n<br /><br />\n- Portrait<br />\n- Party/Indoor<br />\n- Night Portrait<br />\n- Beach/Snow<br />\n- Landscape<br />\n- Sunset<br />\n- Night Landscape<br />\n- Fireworks Show<br />\n- Close up (macro)<br />\n- Copy (black &amp; white)<br />\n- Back light',100,0,'Y',2147483647,2,0,0,0.00,'N','Y',1,10.00,8.00,10.00,10,'N','N',0,7,'','','','N','N',1,'');
INSERT INTO xcart_products VALUES (146,'SKU146','Emerson Microwave (800 W)',1,'',1.00,700.00,'Now cooking with a microwave is faster and more efficient! This sleek Emerson microwave features the new Omni Wave Cooking System that cooks food faster and more evenly. The 0.7 cu. ft. oven has a big-button touchpad with 10 power levels, 5 preprogrammed recipes, auto weight defrost and a pause button. Also includes an electronic child lock-out and lighted compartment with turntable.<br />\nDimensions: 11Hx18Wx13D\"','',100,2,'Y',2147483647,3,0,0,0.00,'N','Y',1,10.00,8.00,10.00,10,'N','N',0,0,'','','','N','N',1,'');
