INSERT INTO xcart_products VALUES (149,'SKU149','Sony MVC-CD200',1,'',1.00,1694.59,'Saving photos has never been easier. With Sony\'s new MVC-CD200 Digital Still Camera, you can store more than 1, 000 VGA still images on a single CD-R compact disc. And that\'s not all. Save more than 90 minutes of MPEG video on the same CD, which is compatible with virtually any computer! Get great Mavica-quality images with the convenience of compact disc storage. For even greater flexibility, you can save the photos on a CD-RW disc, which can be erased and reused hundreds of times. The MVC-CD200 provides 2.0 Effective (2.1 Gross) MP resolution, a 3X optical zoom/6X digital zoom lens and a choice of three MPEG movie modes.','Saving photos has never been easier. With Sony\'s new MVC-CD200 Digital Still Camera, you can store more than 1, 000 VGA still images on a single CD-R compact disc. And that\'s not all. Save more than 90 minutes of MPEG video on the same CD, which is compatible with virtually any computer! Get great Mavica-quality images with the convenience of compact disc storage. For even greater flexibility, you can save the photos on a CD-RW disc, which can be erased and reused hundreds of times. The MVC-CD200 provides 2.0 Effective (2.1 Gross) MP resolution, a 3X optical zoom/6X digital zoom lens and a choice of three MPEG movie modes.\n<br /><br />\n<b>Features:</b><br />\n- 2-megapixel sensor captures 1,600 x 1,200 images for prints at sizes up to 8 x 10 inches<br />\n- Autofocus lens with 3x optical/2x digital (6x total) zoom<br />\n- Stores images on 3-inch mini CD-R discs<br />\n- Discs can be read by virtually all Mac and PC CD-ROM drives<br />\n- Uses proprietary lithium-ion rechargeable battery (included)',100,0,'Y',2147483647,2,0,0,0.00,'N','Y',1,10.00,8.00,10.00,10,'N','N',0,0,'','','','N','N',1,'');
INSERT INTO xcart_products VALUES (150,'SKU150','HP PhotoSmart 912',1,'',1.00,548.78,'2.2 Mpix SLR digital camera, 3x optical zoom, CompactFlash card support, colour: black, metallic silver','Model 912 is an SLR-type digital camera designed for the photo enthusiast who values control and creativity during the picture taking process and afterwards on the PC. Designed with the photo enthusiast in mind, the <em>PhotoSmart 912</em> digital camera delivers the control, performance and flexibility of an SLR camera. The camera was developed with HP\'s imaging technology, creating a \"custom photo lab\" inside the camera. This exclusive HP imaging technology optimizes each individual picture, automatically adjusting for difficult lighting conditions, showing greater detail in highlights and shadows, and ensuring proper contrasts and colors. The <em>HP PhotoSmart 912</em> digital camera features HP imaging technology with 2.24-megapixel resolution and 36-bit color depth to deliver image sharpness that rivals that of expensive 3.2-megapixel cameras, a 2/3-inch professional frame transfer Charged Couple Device (CCD), a Pentax precision lens with 3x optical zoom, and wireless printing using JetSend infrared technology. The result is exceptional detail in 11 x 14-inch prints. Designed with the look and feel of an SLR camera, the <em>HP Photosmart 912</em> digital camera features a 2-inch flip-up color LCD, allowing for easier framing of difficult shots. The camera also offers the same functionality one would expect from an SLR, including manual focus, exposure, and color and flash control.\n<br /><br />\n<b>Highlights:</b><br />\n- 2.24-megapixel CCD delivering up to 1,600 x 1,280-pixel resolution images<br />\n- Two-inch color LCD monitor that tilts up 90 degrees<br />\n- 36-bit color (12 bits per color)<br />\n- Through-the-lens (TTL) optical viewfinder with data display<br />\n- Pentax 3x, 8.2-25.8mm lens (equivalent to a 34-107mm lens on a 35mm camera)<br />\n- Digital telephoto up to 2x<br />\n- Manual and automatic focus control<br />\n- Program AE, Aperture Priority, Shutter Priority, Manual, and special preset exposure modes<br />\n- Manually adjustable aperture ranging from f/2.5 to f/11<br />\n- Shutter speeds from 1/1,000 to four seconds<br />\n- One-shot, Continuous shooting, and Time-Lapse photography modes<br />\n- Audio recording capability<br />\n- Exposure lock, EV bracketing, and adjustable metering modes<br />\n- 25, 50, 100, 200, and 400 ISO equivalents<br />\n- Adjustable White Balance with five modes<br />\n- Built-in, pop-up flash with five modes<br />\n- Hot shoe for mounting an external flash unit<br />\n- IR Remote Control included<br />\n- JPEG and uncompressed TIFF file formats<br />\n- Images saved to CompactFlash memory cards (Type I or II), 16MB card included<br />\n- Power from four AA batteries (set of alkaline batteries included), or HP Li-Ion battery pack<br />\n- JetSend Infrared interface<br />\n- Flashpoint Digita operating interface<br />\n- Digital Print Order Format (DPOF) compatibility<br />\n- Software CDs containing HP Photo Imaging Software, ACDSee Systems Viewer, ArcSoft PhotoImpression, and ArcSoft PhotoMontage<br />\n- USB interface for quick connection to a PC or Macintosh',100,1,'Y',2147483647,0,0,0,0.00,'N','Y',1,10.00,8.00,10.00,10,'N','N',0,0,'','','','N','N',1,'');
INSERT INTO xcart_products VALUES (151,'SKU151','HP PhotoSmart 618',1,'',1.00,1536.92,'HP Photosmart 618 is a versatile point-and-shoot digital camera. This high performance camera gives consistently great pictures. HP imaging technology assures 2.11-megapixel resolution. The camera individually optimizes each picture for crisp, brilliant pictures. Get closer to your subject with Pentax 3x optical zoom lens and 2x digital zoom. Manual controls include aperture and shutter priority, picture and metering modes and ISO speed control giving you more creative control over picture taking.HP PhotoSmart 618 is ideal for experienced photographers and PC technologists, offering them automatic functionality, as well as manual control in a portable, point-and-shoot camera. Your camera comes equipped with four operating modes. To set the mode, turn the camera mode dial on top of the camera to the mode you want to use. PhotoSmart 618 features six exposure settings: auto, landscape program, portrait program, action program, aperture priority, and shutter priority. The built-in flash can operate in seven flash modes - auto, auto with red-eye reduction, forced on, forced on with red-eye reduction, forced off, night, and night with red-eye reduction. Three timer modes include off, 10-second timer, and 3-second remote.','HP Photosmart 618 is a versatile point-and-shoot digital camera. This high performance camera gives consistently great pictures. HP imaging technology assures 2.11-megapixel resolution. The camera individually optimizes each picture for crisp, brilliant pictures. Get closer to your subject with Pentax 3x optical zoom lens and 2x digital zoom. Manual controls include aperture and shutter priority, picture and metering modes and ISO speed control giving you more creative control over picture taking.HP PhotoSmart 618 is ideal for experienced photographers and PC technologists, offering them automatic functionality, as well as manual control in a portable, point-and-shoot camera. Your camera comes equipped with four operating modes. To set the mode, turn the camera mode dial on top of the camera to the mode you want to use. PhotoSmart 618 features six exposure settings: auto, landscape program, portrait program, action program, aperture priority, and shutter priority. The built-in flash can operate in seven flash modes - auto, auto with red-eye reduction, forced on, forced on with red-eye reduction, forced off, night, and night with red-eye reduction. Three timer modes include off, 10-second timer, and 3-second remote.\n<br /><br />\n<b>Features:</b><br />\n- 2.1-megapixel sensor for prints up to 8 by 10 inches<br />\n- 3x optical plus 2x digital zoom Pentax autofocus lens<br />\n- Included 16 MB CompactFlash memory card holds 28 images at default resolution<br />\n- Connects with Macs and PCs via USB port<br />\n- Uses 4 AA batteries (disposable lithium batteries included)<br />\n- jointly designed with Pentax<br />\n- uses Digita operating system',100,0,'Y',2147483647,0,0,0,0.00,'N','Y',1,10.00,8.00,10.00,10,'N','N',0,0,'','','','N','N',1,'');
