INSERT INTO xcart_products VALUES (174,'SKU174','Windows Millennium',1,'/provider/windows_me.zip',1.00,355.56,'Microsoft Windows Millennium Edition - Complete Package - 1 user - CD','Windows Millennium is loaded with features designed specifically for home users. You\'ll have the power to manage digital photos and music, work with video, create a home network, and communicate with friends and relatives around the world. A wealth of wizards, tutorials, and a redesigned Help Center make using your computer easy, and built-in system safeguards keep things running smoothly. Creating a home network and connecting new devices is easier than ever. Now you can share printers, music, an Internet connection, and digital pictures throughout your home. Windows Me provides the most powerful and reliable way to browse your favorite Web sites, send e-mail and instant messages, and play online games.\n<br /><br />\nMicrosoft Windows ME (WindowsME, WinME) boots up quicker because it does not process the config.sys &amp; autoexec.bat and does not display the whole MS-DOS user interface. Microsoft Win ME (WindowsME, WinME) boots up about 25%+ quicker BUT only on new PC\'s that are designed to. Existing PC will only boot up a couple of seconds quicker. On the down side Windows ME works just a little slower, 5% or less slower than Win98, probably caused by the PC Health check features running all the time.',100,3,'Y',2147483647,8,0,0,0.00,'N','Y',1,10.00,8.00,10.00,10,'N','N',0,0,'','','','N','N',1,'');
INSERT INTO xcart_products VALUES (176,'SKU176','Logitech Cordless Desktop iTouch',1,'',1.00,155.84,'With convenient iTouch Internet and multimedia control from Logitech, access the Internet, search, play CDs, MP3 and Windows media files, adjust volume and more with one touch of a key. Radio technology works without a clear path or pointing at your computer.','Logitech Cordless Desktop iTouch brings together a reliable cordless mouse and cordless keyboard to free you from the limits of cords. Now you have the flexibility to place your mouse and keyboard where you choose, and you can work the way that\'s most comfortable for you. Stop struggling with cords that catch and tangle. This cordless mouse and keyboard give you the flexibility to arrange your desk without pointing them at the computer or requiring a clear path. They provide reliable performance even on crowded desks where cups, piles of paper, books, and other objects come between them and the computer.\n<br /><br />\nWith one touch of an iTouch key, you can access the Internet, go to your custom Web page, buy online, open e-mail, search, or launch your favorite applications. You can also play CDs, MP3s, Windows media files, and DVDs or mute and change volume with iTouch convenience.\n<br /><br />\n<b>Features:</b><br />\n- Mouse fits right- and left-handers<br />\n- Removable, ergonomic wrist rest<br />\n- Cordless keyboard and wheel mouse free you from cables<br />\n- Digital radio technology means you don\'t have to point the keyboard or mouse<br />\n- iTouch software for easy Internet and multimedia control',100,1,'Y',2147483647,1,0,0,0.00,'N','Y',1,10.00,8.00,10.00,10,'N','N',0,0,'','','','N','N',1,'');
INSERT INTO xcart_products VALUES (177,'SKU177','HP LaserJet 1200',1,'',1.00,882.35,'Hewlett-Packard\'s LaserJet 1200 is poised to replace the HP LaserJet 1100xi, a low-cost laser we\'ve known and loved for its excellent print quality and its versatile copy/scan attachment. Improving on a good thing can be difficult, but in this case, HP succeeds admirably. The LaserJet 1200 fixes all the things we disliked about the 1100xi and delivers better print quality at faster speeds - all for the same low price.','',100,0,'Y',2147483647,0,0,0,0.00,'N','Y',1,10.00,8.00,10.00,10,'N','N',0,0,'','','','N','N',1,'');
INSERT INTO xcart_products VALUES (178,'SKU178','HP LaserJet 2100M',1,'',1.00,1392.41,'Get quick prints for now and a durable printer for the future with HP\'s LaserJet 2100M laser printer. This desktop printer is suitable for small workgroups and single users who need advanced printing features and professional print results. The LaserJet 2100M is a monochrome laser printer with a 1200 x 1200 dpi output at up to 10 ppm. Its memory can be upgraded to 40MB with optional memory modules. The instant-on fuser eliminates warm-up time so the first print is out within 17 seconds. The LaserJet 2100M is built for the longhaul with a 15,000-page/month duty cycle. The UltraPrecise toner cartridge has a 5,000 page life cycle and yields sharper blacks and finer grayscales than conventional tonercartridges. The result is compelling prints suitable for corporate presentations.','',100,0,'Y',2147483647,0,0,0,0.00,'N','Y',1,10.00,8.00,10.00,10,'N','N',0,0,'','','','N','N',1,'');
INSERT INTO xcart_products VALUES (179,'SKU179','HP LaserJet 2200D',1,'',1.00,1666.67,'HP LaserJet 2200 series delivers a feature-packed, Internet-enabled, easy-to-use printer and maintain HP\'s high standard for reliability. The 2200 series is the solution that puts quality, performance, and value in the same package.Fast print speed, instant-on fuser, large memory, fast processor and a high monthly duty cycle deliver the best performance for small workgroups. True 1200-dpi printing at full-engine speed provides superior print quality. Instant-on fuser eliminates warm up time. Fast Infrared (FIR) receiver allows point-and-print wireless printing from portable PCs, PDAs, and cell phones without special drivers. Embedded Web Server provides remote printer status and network configuration.','The HP LaserJet 2200D delivers true 1200 dpi resolution at full engine speed. Powered by an impressive 133MHz processor and boasting print speeds of up to 19ppm in black this printer delivers crisp high quality output at a quick pace. When used with compatible HP supplies, the LaserJet 2200D is a complete solution for your printing needs and would be a great investment for small workgroups, businesses or individuals with advanced printing needs. Other features include its 8 MB RAM, duplex printing (two-sided printing), 2 paper trays (100-sheet &amp; 250-sheet), Fast InfraRed wireless receiver, and USB port.\n<br /><br />\n- 1200 x 1200 DPI<br />\n- 19 PPM<br />\n- 8 MB Memory (expandable to 72MB)<br />\n- 1 wireless Fast InfraRed (FIR) port (IrDA compliant)<br />\n- Connects Via Parallel and USB<br />\n- Built-in Duplexing (2-sided printing)<br />\n- First Page Out in 15 Seconds<br />\n- Automatic Duplex Unit Included<br />\n- Environments: Windows 3.1, 95, 98, 2000, NT 4.0, XP, DOS, OS/2, Macintosh 7.5+, OS X (Classic Mode Only)',100,0,'Y',2147483647,0,0,0,0.00,'N','Y',1,10.00,8.00,10.00,10,'N','N',0,0,'','','','N','N',1,'');
INSERT INTO xcart_products VALUES (182,'SKU182','Hunting Knife w/sheath',1,'',0.50,280.00,'This 8 1/4 \" beauty will make a great addition to your knife collection or a great gift for that special person.\n<br /><br />\nA quality hunting knife with a heavy 4-inch blade and an overall length of 8.25-inches. Hand crafted from only the finest materials, including full Tang high-carbon no-stain steel. Featuring a non-slip handle to give you a good grip in all environments. Incredibly sharp, perfectly balanced. A lifetime guarantee against breakage. Limited run of 50 pieces, each knife is serial numbered. Comes with a hand-made leather sheath.\n','',10,0,'Y',1144836502,3,0,0,0.00,'N','Y',1,10.00,8.00,10.00,2,'N','N',0,0,'knife','','','N','N',1,'');
