INSERT INTO xcart_products VALUES (195,'SKU195','Panasonic SJ-MR200',1,'',1.00,498.75,'Portable Minidisc Recorder<br />\n<b>Features:</b><br />\n- one of the smallest and lightest MD recorders available<br />\n- slim design<br />\n- large, two lines display<br />\n- smart operation pad for easy titling &amp; editing<br />\n- 40-second antishock<br />\n- remote control with backlight LCD','',100,3,'Y',2147483647,2,0,0,0.00,'N','Y',1,10.00,8.00,10.00,10,'N','N',0,0,'','','','N','N',1,'');
